R = T2.SAMPLE_NUMBER\\nINNER JOIN GLIMS_OWNER.RESULT R3 on T2.TEST_NUMBER = R3.TEST_NUMBER\\nLEFT OUTER JOIN GLIMS_OWNER.X_MATERIAL M1 on S1.X_MATERIAL = M1.NAME\\n\\nWHERE \\nR3.STATUS != 'X'\\nAND T2.STATUS != 'X'\\nAND TZ1.PROTOCOL = ?\\nAND R3.REPORTED_NAME IN ('Color Intensity','Clarity','Color','pH','Relative Potency','Visible Particles','Fragments')\\n\\nORDER BY\\nANALYSIS, \\"Reported Name\\", \\"Formulation\\", \\"Protocol Level\\", \\"Timepoint\\", \\"Condition\\"\\n\\n",       "DisplayHeaders" : true,       "Transpose" : true,       "IsPivot" : true,       "PivotOnColumns" : [         {           "Column" : "Reported Name",           "Label" : null,           "IsKeyColumn" : true,           "MergeHorizontal" : null,           "MergeVertical" : null         },         {           "Column" : "Formulation",           "Label" : null,           "IsKeyColumn" : true,           "MergeHorizontal" : null,           "MergeVertical" : null         },         {           "Column" : "Description",           "Label" : null,           "IsKeyColumn" : true,           "MergeHorizontal" : null,           "MergeVertical" : null         }       ],       "PivotGroupByColumns" : [         {           "Column" : "Timepoint",           "Label" : null,           "MergeHorizontal" : null,           "MergeVertical" : null         },         {           "Column" : "Condition",           "Label" : null,           "MergeHorizontal" : null,           "MergeVertical" : null         }       ],       "PivotDataColumn" : "Reported Value",       "PivotTopLeftCornerOpt" : "Pivot On Label"     },     {       "TableDefinitionId" : 82,       "SourceType" : "Db Query",       "ResultTableType" : "Data Table",       "ParamUserInputMap" : [         {           "ParamName" : "Statement#0_S1.PROTOCOL",           "UserInputId" : 162         },         {           "ParamName" : "Statement#1_TZ1.PROTOCOL",           "UserInputId" : 162         }       ]     }   ] }

